import React from 'react';
import { render } from 'react-dom';
import './index.css';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import * as serviceWorker from './serviceWorker';
import Concours from './components/Concours/Concours';
import {Accueil} from './components/Accueil';
import {Notifications} from './components/user/Notifications'
import Staff from './components/Administration/Staff'
import Examens from './components/Examens/Examens'
import Navbar from './components/Navbar'
import ProtectedRoute from'./components/ProtectedRoute';
import PublicRoute from './components/PublicRoute';
import { Search } from './components/Search';
//import ClientRoute from './components/ClientRoute';


render(  
  <div>

    <Router>
        <Navbar/>
        <PublicRoute exact path="/" component={Accueil}/>
        <PublicRoute exact path="/Search" component={Search}/>
        <PublicRoute exact path="/Concours" component={Concours}/>
        <PublicRoute exact path="/Examens" component={Examens}/>
        <PublicRoute exact path="/notifications" component={Notifications}/>
        <PublicRoute exact path="/notifications" component={Notifications}/>
        <ProtectedRoute exact path="/staff" component={Staff}/>
    </Router>

  </div>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.register();
